    "---\n",
    "title: \"Final Capstone Project\"\n",
    "author: \"Johnny Tay\"\n",
    "output: html_document\n",
    "---\n",
    "\n",
    "# Background of the Project\n",
    "\n",
    "Bellabeat, a high-tech manufacturer of health-focused products for women, wants to analyze smart device fitness data to unlock new growth opportunities for the company. In this project, we will be focusing on one of Bellabeat's products and analyze smart device data to gain insight into how consumers are using their smart devices. The insights shall be used to guide the marketing strategy for the company.\n",
    "\n",
    "## Steps in the analysis:\n",
    "\n",
    "## 1. ASK\n",
    "\n",
    "   a. What are some trends in smart device usage?\n",
    "\n",
    "   There is an increasing variety of wearable technology over the past few years, from smart wearable clothing to smart helmets, smart glasses to smart rings, smartwatches to smart implantables and these devices have gradually gained acceptance by people all over the world.\n",
    "\n",
    "   b. How could these trends apply to Bellabeat customers?\n",
    "\n",
    "   Many people uses smart devices to track health metrics such as the level of activity, the number of steps, and the calories burnt etc. Bellabeat focuses on meeting woman needs in one place (i.e. workouts, nutrition, mindfulness techniques, and menstrual cycle support) and tailors its expert-based content to each stage of the cycle and goals. \n",
    "\n",
    "   c. How could these trends help influence Bellabeat marketing strategy?\n",
    "\n",
    "   By knowing how people uses smart devices, Bellabeat will be able to have a better understanding on usage patterns and tailor their products to meet their customer's requirement.\n",
    "\n",
    "## 2. PREPARE\n",
    "\n",
    "### 2A. PREPARE DAILY DATASET\n",
    "\n",
    "The dataset that is available to me is obtained from https://www.kaggle.com/datasets/arashnic/fitbit (CC0: Public Domain, dataset made available through Mobius): This Kaggle data set contains personal fitness tracker from thirty fitbit users. Thirty eligible Fitbit users consented to the submission of personal tracker data, including minute-level output for physical activity, heart rate, and sleep monitoring. It includes information about daily activity, steps, and heart rate that can be used to explore users’ habits\n",
    "\n",
    "### Install the packages and load the libraries\n",
    "\n",
    "We will be performing the analysis using Rstudio Cloud. The datsets are first loaded into the working directory in Rstudio. Then we start by installing the relevant packages and libraries in order to start exploring our dataset."
   ]
  },
