   "source": [
    "### Load data\n",
    "\n",
    "We have loaded the 4 datasets as these are the datasets that are most useful for this project. The dailyActivity_merged dataset has a consolidated info on daily calories, intensities, steps etc for all users. We have chosen the hourly dataset for more granular breakdown of calories, intensities, steps of each user throughout the day instead of using minutes data as the hourly data has sufficient granularity and any join or compute operations will be more manageable since the hourly data has 22k rows while the minute data has >1.3m rows."
