   "source": [
    "Upon investigation, we realized that only 32 out of 940 rows (or 3%) in \"LoggedActivitiesDistance\" have non-zero values.\n",
    "\n",
    "We further found that activity logs are records of specific activities that a Fitbit user (participant) completed through one of five different methods.\n",
    "\n",
    "1.  Auto-detected activities that are recognized through Fitbit's\n",
    "    SmartTrack feature.\n",
    "2.  Activities initiated from the tracker such as runs, walks, hikes, or\n",
    "    workouts.\n",
    "3.  Manually created activities created by the user via the Fitbit\n",
    "    mobile app or web dashboard.\n",
    "4.  Runs, walks, or hikes created using the MobileRun (phone GPS)\n",
    "    feature within the Fitbit mobile app.\n",
    "5.  Workouts completed while using the FitStar (now called Fitbit Coach)\n",
    "    workout app.\n",
    "\n",
    "If the user had not done the above, there will be no records. Hence, we decided to ignore the \"LoggedActivitiesDistance\" and drop this column as most of the users have no requirement for this feature."
   ]
