   "source": [
    "dailyActivity_merged$VeryActiveDistance <- as.numeric(dailyActivity_merged$VeryActiveDistance)\n",
    "dailyActivity_merged$ModeratelyActiveDistance <- as.numeric(dailyActivity_merged$ModeratelyActiveDistance)\n",
    "dailyActivity_merged$LightActiveDistance <- as.numeric(dailyActivity_merged$LightActiveDistance)\n",
    "dailyActivity_merged$SedentaryActiveDistance <- as.numeric(dailyActivity_merged$SedentaryActiveDistance)\n",
    "\n",
    "dailyActivity_merged <- dailyActivity_merged %>% \n",
    "  add_column(ComputedTotDist = (dailyActivity_merged$VeryActiveDistance+dailyActivity_merged$ModeratelyActiveDistance+dailyActivity_merged$LightActiveDistance+dailyActivity_merged$SedentaryActiveDistance), .after = 'TotalDistance')\n",
    "\n",
    "View(dailyActivity_merged)"
   ]
  },
