   "source": [
    "Then we compute the difference between 2 columns:\n",
    "\n",
    "1.  'TotalDistance' and 'ComputedTotDist' and\n",
    "2.  'TotalDistance' and 'TrackerDistance'\n",
    "\n",
    "Due possibly to rounding off, most of the values between 'TotalDistance' and 'ComputedTotDist' are not exactly the same. To give some allowance for round off, we see the rows in which difference between 'TotalDistance' and 'ComputedTotDist' are more than 0.5km are these are more unlikely due to the effect of round off."
   ]
