   "source": [
    "## 4. SHARE\n",
    "\n",
    "### 4A. Findings on the daily dataset\n",
    "\n",
    "The following findings can be obtained from the analysis of the daily dataset.\n",
    "\n",
    "- Plot of Total Calories vs Total Distance: There exist a positive linear relationship between Total Calories and Total Distance, where the more distance clocked, the higher the calories burn. This is in line with common knowledge.\n",
    "\n",
    "- Plot of Total Calories vs Total Sedentary Minutes: There exist a negative linear relationship between Total Calories and Total Sedentary Minutes, where the more time a user is sedentary and not doing any active activity, the lower the calories burn. \n",
    "\n",
    "- Plot of Total Calories vs Total Active Minutes: There exist a positive linear relationship between Total Calories and Total Active Minutes, where the more active time clocked, the higher the calories burn.\n",
    "\n",
    "- Plot of Total Calories vs Total Steps: There exist a positive linear relationship between Total Calories vs Total Steps, where the more steps taken, the higher the calories burn.\n",
    "\n",
    "- Plot of Total Distance vs Date throughout the month: For most users, the daily distance clocked is fairly constant throughout the month. However, a handful of the users started the month with some activities but stopped completely or shows a declined level of activity after a few days or half of the month. This could signal a lack of motivation after the start of the month.\n",
    "\n",
    "### 4B. Findings on the Hourly dataset\n",
    "\n",
    "The following findings can be obtained from the analysis of the hourly dataset.\n",
    "\n",
    "- Plot of Total Calories vs Time of day (with color size dots on TotalIntensity): This plot shows that users total calories burnt are more between 12pm - 2pm and 5pm - 6pm. However, the intensity is equally high for users in the morning (between 5am - 6am) as with user intensities between 12pm - 2pm and 5pm - 6pm. This probably shows the hours that users chooses to do workout (possibly during early morning, lunch hours or after work), although more people do their work out during lunch hours and after working hours as compared to the morning hours.\n",
    "\n",
    "- Plot of Total Calories vs Time of day (with color size dots on TotalSteps): This plot is interesting as it shows that users total calories burnt are more between 12pm - 2pm and 5pm - 6pm which is similar to above plot. However, the number of steps taken is significantly higher between 12pm - 2pm and 5pm - 6pm as compared to the morning hours. This may mean that the type of workout in the afternoon and evening may be relating to walking, running/jogging as compared to morning hours (which may be gym or yoga type workouts)\n",
    "\n",
    "## 5. ACT\n",
    "\n",
    "Based on the above findings, it is obvious that the more steps, active minutes and distance clocked, the more the calories burnt. With BellaBeat current product lineup, BellaBeat can focus on the following marketing efforts:\n",
    "\n",
    "1. Users tend to be less active during the morning and mid afternoons. When the BellaBeat products detected period of lesser activity during the day using their devices, they can prompt users using their Ivy app to start moving and clock more steps etc.\n",
    "\n",
    "2. Users may have a certain goal every month (to clock certain distance / steps) but some tend to lose motivation shortly after the start of the month. BelleBeat can come up with reminders, games or challengers to motivate users when they detected period of low or no activities.\n",
    "\n",
    "3. Focus on continuing development of products that users are comfortable to wear during workouts and throughout the day.\n"
   ]
